import { Link } from 'react-router-dom'
import './home.css'

export default function Home() {
  
  const dispatch=useDispatch();
      
  useEffect(() => {
        
    dispatch(getPokemon())
    dispatch(getPokemonType())
    dispatch(getPokemon())
    
    
   
  },[]);
  return (


    <>
    <br />
        <div className='home'>
        
        <Link className='home-boton' to="/pokemon">Entrar</Link>
      
        </div>
    </>
   
  )
}
